import React from 'react'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMagicWandSparkles,faEllipsis } from "@fortawesome/free-solid-svg-icons";
const listTitle = () => {
  return (
    <div className="listTitle">
        <FontAwesomeIcon className="headingIcon" icon={faMagicWandSparkles} size="1xl" />
        <div className="titleContent">
        <span class="heading">Wishlist</span>
        <span class="heading">5 Jobs</span>


        </div>

        <FontAwesomeIcon className="headingIcon"  icon={faEllipsis} size="xl"/>
    </div>

  )
}

export default listTitle
